  //    key="overlay-1"
  //    overlay={<Popover id="popover1" title="Popover right">Test</Popover>}
  //   >
  //   </OverlayTrigger>
  // );

  window.onload = function () {
    var ImageMap = function (map, img) {
            var n,
                areas = map.getElementsByTagName('area'),
                len = areas.length,
                coords = [],
                previousWidth = 128;
            for (n = 0; n < len; n++) {
                coords[n] = areas[n].coords.split(',');
            }
            this.resize = function () {
                var n, m, clen,
                    x = img.offsetWidth / previousWidth;
                for (n = 0; n < len; n++) {
                    clen = coords[n].length;
                    for (m = 0; m < clen; m++) {
                        coords[n][m] *= x;
                    }
                    areas[n].coords = coords[n].join(',');
                }
                previousWidth = document.body.clientWidth;
                return true;
            };
            window.onresize = this.resize;
        },
        imageMap = new ImageMap(document.getElementById('map_ID'), document.getElementById('img_ID'));
    imageMap.resize();
    return;
}



  return (
    <body>
    <div className="Div">
      <img src={require("./architecture3.png")}
          alt="App architecture" 

          border="0" 
          width="100%"
          usemap="#image-map" /> 
    </div>
    <div>
    <map name="image-map">
    <area target="_blank" alt="1" title="1" href="#popover1" coords="266,117,17" shape="circle" />
    <area target="_blank" alt="2" title="2" href="2" coords="494,397,21" shape="circle" />
    <area target="_blank" alt="3" title="3" href="3" coords="969,397,18" shape="circle" />
    <area target="_blank" alt="4" title="4" href="4" coords="1242,661,19" shape="circle" />
    <area target="_blank" alt="5" title="5" href="5" coords="968,518,19" shape="circle" />
    <area target="_blank" alt="6" title="6" href="6" coords="497,518,22" shape="circle" />
    </map>
    </div>
    </body>
  )


  }





